// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

/**
 * @title SimpleAuction
 * @dev Implements a simple open auction where bidders can place bids and
 *      the highest bidder wins after the auction ends.
 */
contract SimpleAuction {
    // Address of the auction beneficiary (the recipient of the highest bid)
    address payable public beneficiary;

    // Timestamp indicating when the auction ends
    uint256 public auctionEndTime;

    // Address of the highest bidder
    address public highestBidder;

    // Amount of the highest bid
    uint256 public highestBid;

    // Mapping to store pending returns for bidders who got outbid
    mapping(address => uint256) pendingReturns;

    // Boolean flag to indicate whether the auction has ended
    bool ended;

    // Events to log key auction activities
    event HighestBidIncreased(address bidder, uint256 amount);
    event AuctionEnded(address winner, uint256 amount);

    // Custom errors for better gas efficiency
    error AuctionAlreadyEnded();
    error BidNotHighEnough(uint256 highestBid);
    error AuctionNotYetEnded();
    error AuctionEndAlreadyCalled();

    /**
     * @dev Constructor initializes the auction with a specified duration
     *      and beneficiary address.
     * @param biddingTime Duration of the auction (in seconds)
     * @param beneficiaryAddress Address to receive the highest bid
     */
    constructor(uint256 biddingTime, address payable beneficiaryAddress) {
        beneficiary = beneficiaryAddress;
        auctionEndTime = block.timestamp + biddingTime;
    }

    /**
     * @dev Allows users to place a bid. If the bid is higher than the current
     *      highest bid, the previous highest bidder's bid is refunded.
     */
    function bid() external payable {
        if (block.timestamp > auctionEndTime) revert AuctionAlreadyEnded();
        if (msg.value <= highestBid) revert BidNotHighEnough(highestBid);

        if (highestBid != 0) {
            uint256 refundAmount = highestBid;
            address payable previousBidder = payable(highestBidder);

            // Update the highest bid and highest bidder
            highestBidder = msg.sender;
            highestBid = msg.value;

            emit HighestBidIncreased(msg.sender, msg.value);

            // Refund the previous highest bidder
            previousBidder.transfer(refundAmount);
        } else {
            highestBidder = msg.sender;
            highestBid = msg.value;
            emit HighestBidIncreased(msg.sender, msg.value);
        }
    }

    /**
     * @dev Allows bidders to withdraw their pending returns if they were outbid.
     * @return success True if the withdrawal was successful, false otherwise.
     */
    function withdraw() external returns (bool success) {
        uint256 amount = pendingReturns[msg.sender];
        if (amount > 0) {
            pendingReturns[msg.sender] = 0;

            (bool sent, ) = payable(msg.sender).call{value: amount}("");
            if (!sent) {
                pendingReturns[msg.sender] = amount; // Revert the change in case of failure
                return false;
            }
        }
        return true;
    }

    /**
     * @dev Ends the auction and transfers the highest bid to the beneficiary.
     *      Can only be called after the auction has ended.
     */
    function auctionEnd() external {
        if (block.timestamp < auctionEndTime) revert AuctionNotYetEnded();
        if (ended) revert AuctionEndAlreadyCalled();

        ended = true;
        emit AuctionEnded(highestBidder, highestBid);

        // Transfer the highest bid to the beneficiary
        beneficiary.transfer(highestBid);
    }

    /**
     * @dev Prevents accidental direct ETH transfers to the contract.
     */
    receive() external payable {
        revert("Direct ETH transfer not allowed.");
    }

    /**
     * @dev Fallback function to handle unexpected function calls.
     */
    fallback() external payable {
        revert("Function does not exist.");
    }
}

